INSERT INTO `groups` (`id`, `name`, `description`, `context`, `prerequisite`, `email`, `image`, `restrict_access`, `chat_link`, `drive_link`, `status`, `state`, `visibility`, `creator_id`, `creation_date`) VALUES
	(1, 'GT Finances', 'Ce groupe s\'occupe de gérer les finances de l\'association. Il gère les dons, les dépenses, les demandes d\'argent, et gère le compte bancaire.', 'Ce groupe a été créé après un problème avec les finances. Le problème était que trop peu de personnes s\'en occupaient.', 'Connaissances minimales en comptabilité requises. Le reste peu être appris sur le tas si vous voulez vous intégrer dans ce groupe. De la rigueur administrative est aussi de mise.', NULL, 'group_5ecjoxx4zzza8cni2zv4t523buef6n.jpg', 0, 'chat.link/join?v=ecj5bsuqx315tfd', 'drive.link/open?f=lni22jgvken2tokwfazj3tw5d29r5xvf5cg00s0kwod7wqtlprs2s8c53iotdafatgnpkb', 'Travail une fois par mois pour les tâches répétitives', 0, 3, 67, '2020-06-06 06:16:05'),
	(2, 'GT Réflexion interne', 'Groupe pour réfléchir au fonctionnement interne.', 'Différentes tensions entre certains membres.', 'A partir du moment que vous avez constaté ou pu expérimenter des problèmes internes dans l\'organisation et la structure, vous êtes aptes à travailler dans ce groupe.', NULL, 'group_oivabk34kanwygt3vywoeplzf0lqox.jpg', 0, 'chat.link/join?v=mz0d274pgdwn', 'drive.link/open?f=hia9i38mveqq65a7t7tbr7cwtsa4jxsl35vaun42nbndjmz78lv270g0e', '', 1, 3, 88, '2020-01-30 17:49:21'),
	(3, 'Coordination', 'Coordination générale. Fait des AG toutes les 2 semaines.', 'Besoin d\'un groupe contenant tout les membres.', 'Lorem ipsum dolor sit amet, consectetur adipiscing elit. Et summatim quidem haec erant de corpore animoque dicenda, quibus quasi informatum est quid hominis natura postulet. Ut pompa, ludis atque eius modi spectaculis teneantur ob eamque rem vel famem et sitim perferant? Quid igitur, inquit, eos responsuros putas? Nam diligi et carum esse iucundum est propterea, quia tutiorem vitam et voluptatem pleniorem efficit. Nobis Heracleotes ille Dionysius flagitiose descivisse videtur a Stoicis propter', NULL, 'group_ufgdaawfard697vev4q7biit5onz1v.jpg', 1, 'chat.link/join?v=p4yt2mosm93ut9', 'drive.link/open?f=gc9vv4hsidugtw6q6zrpvpkaj2hl6i1kvllb7sr4r94i6xacbsesr', '', 1, 3, 11, '2019-02-04 01:43:00'),
	(4, 'GT Journal', 'Collaboration avec un journal régional mensuel pour un prochain numéro consacré à l\'association. Le journal sera publié fin mai.', 'Envie de prendre place dans l\'espace médiatique et de se faire connaître...', 'Aimer écrire ou dessiner. Les textes sont travaillés très longtemps avant d\'arriver dans leur phase finale.', NULL, NULL, 0, 'chat.link/join?v=zpb6mlauy968d', 'drive.link/open?f=c8woa4heg1ea3z625xdbsjyfj97gsd7hfdezgphol0jrbh4p5r5', 'En pause pour cause du covid et reporté en septembre.', 1, 3, 11, '2019-11-13 21:25:15'),
	(5, 'GT Festival', 'Organise les "festivals" annuels de l\'association.', '', 'Lorem ipsum dolor sit amet, consectetur adipiscing elit. Sed eum qui audiebant, quoad poterant, defendebant sententiam suam. Atqui iste locus est, Piso, tibi etiam atque etiam confirmandus, inquam; Duo Reges: constructio interrete. Fadio Gallo, cuius in testamento scriptum esset se ab eo rogatum ut omnis hereditas ad filiam perveniret. Qui convenit? Tenesne igitur, inquam, Hieronymus Rhodius quid dicat esse summum bonum, quo putet omnia referri oportere? At iam decimum annum in spelunca iacet.', NULL, 'group_2mzics1tk66xw6d3q6hsqmplj4pqud.jpg', 0, 'chat.link/join?v=57qxz0toryslet', 'drive.link/open?f=ne177qziwksl4marknqwzd2pwng2d94f6am7r5mirka9osyexpkc7jihoew8p84thau9e1', '', 1, 4, 21, '2019-07-20 21:58:53'),
	(6, 'GT Multimédia', 'Crée tous les design et médias dont l\'association a besoin. Affiches, vidéos, photos, montages, ...', 'Rassemblement des personnes créatives de l\'association.', 'Lorem ipsum dolor sit amet, consectetur adipiscing elit. Quid enim est a Chrysippo praetermissum in Stoicis? Superiores tres erant, quae esse possent, quarum est una sola defensa, eaque vehementer. In sapientem solum cadit, isque finis bonorum, ut ab ipsis Stoicis scriptum videmus, a Xenocrate atque ab Aristotele constitutus est. Levatio igitur vitiorum magna fit in iis, qui habent ad virtutem progressionis aliquantum. \n\n', NULL, 'group_2fg2k8ip25uujr77t4tfyegn4puusp.jpg', 0, 'chat.link/join?v=69tx1iuc1inczj', 'drive.link/open?f=80ows6xpj65z05lqt5u0ptn94im80rxfh1vyqa1r989ox5iei0pvvkj4o2mcx', 'Peu actif...', 2, 3, 33, '2019-11-15 22:00:06'),
	(7, 'GT Sites web', 'Ce GT s\'occupe des sites web et de leur maintenance.', 'Besoin de connaissances un peu technique et des personnes qui se portent responsables.', NULL, NULL, NULL, 1, 'chat.link/join?v=dkmrk5xnrzz0', 'drive.link/open?f=8j2c8kdfv8jx9uk62l0fu3wx49lcw0eqz2icnt9ms4xznzwqvn7wwg5apkmc3f', 'Travail actif sur le site cantonal...', 1, 3, 42, '2019-11-18 04:53:31'),
	(8, 'GT Communication', 'Gére toute la communication interne et externe de l\'association. Gère les différents réseaux sociaux.', '', NULL, NULL, NULL, 0, 'chat.link/join?v=ol9kkwqvdum', 'drive.link/open?f=7rkj36jnjyqi4g5skqpovh99v4rkhejewbbt8d6p44euolo0uvyi94b4ozic', 'Textes et messages envoyés tous les jours. Très actif pour la réfléxion.', 1, 3, 81, '2020-03-29 16:27:55'),
	(9, 'GT Education', 'Fait des formations en ligne pour des membres internes et externes.', 'Volonté de se former au thèmes de l\'association.', 'Lorem ipsum dolor sit amet, consectetur adipiscing elit. Qui autem esse poteris, nisi te amor ipse ceperit? Bonum incolumis acies: misera caecitas. Potius inflammat, ut coercendi magis quam dedocendi esse videantur. Item de contrariis, a quibus ad genera formasque generum venerunt. \n\n', NULL, NULL, 0, 'chat.link/join?v=971soz2yi5822', 'drive.link/open?f=mrcj4s7dv2huer76jqx3h0tqobkh8oj9swrtip1j732ibz1v0b4cc7ewv7', 'Formations intenses entre le 15 et le 23. Ensuite pause.', 1, 3, 67, '2020-05-11 15:43:09'),
	(10, '"GT" relations externes', 'Permet de gérer les relations externes, que ce soit les médias, la presse, les demandes d\'interview, ...', 'Beaucoup de demandes d\'interview après le festival 2019.', 'Lorem ipsum dolor sit amet, consectetur adipiscing elit. Tollitur beneficium, tollitur gratia, quae sunt vincla concordiae. Eadem nunc mea adversum te oratio est. Quae qui non vident, nihil umquam magnum ac cognitione dignum amaverunt. Sed haec quidem liberius ab eo dicuntur et saepius. Duo Reges: constructio interrete. Huic verbo omnes, qui ubique sunt, qui Latine sciunt, duas res subiciunt, laetitiam in animo, commotionem suavem iucunditatis in corpore. Bonum negas esse divitias, praeposìtu', NULL, NULL, 1, 'chat.link/join?v=flq6rnw8em', 'drive.link/open?f=2qp6lnt8e9tr2kzyinc3bnzcgfq7o3m0qxhyw2xntgerktk2rhs4qf6tu73', '', 1, 3, 11, '2019-06-30 09:33:14'),
	(11, 'GT boîte mail', 'Gestion de la boite mail et réponses aux messages.', '', 'Lorem ipsum dolor sit amet, consectetur adipiscing elit. Inscite autem medicinae et gubernationis ultimum cum ultimo sapientiae comparatur. Sit voluptas non minor in nasturcio illo, quo vesci Persas esse solitos scribit Xenophon, quam in Syracusanis mensis, quae a Platone graviter vituperantur; Praeterea et appetendi et refugiendi et omnino rerum gerendarum initia proficiscuntur aut a voluptate aut a dolore. Ergo, si semel tristior effectus est, hilara vita amissa est? Quod autem magnum dolore', 'mail@assoc.ch', 'group_blwt3uw94psz9n8xtmy1fym3exo8b2.jpg', 0, 'chat.link/join?v=v2cxk2lc1sc5', 'drive.link/open?f=okvhm34uk1aa57x7ceeuai663ule6zlylo3nn1lak5p9r7i3nuhukim5', 'Une personne gère la boite mail par jour et ce tous les jours.', 0, 3, 75, '2019-07-12 08:15:13'),
	(12, 'GT Anniversaire', 'Organisation d\'une fête surprise pour les membres de Assoc. L\'événement doit rester secret jusqu\'à 3 jours avant l\'événement.', 'C\'est le 20ème anniversaire de Assoc le 15 décembre 2020. Cette date doit rester en mémoire.', 'Lorem ipsum dolor sit amet, consectetur adipiscing elit. Deinde qui fit, ut ego nesciam, sciant omnes, quicumque Epicurei esse voluerunt? Materiam vero rerum et copiam apud hos exilem, apud illos uberrimam reperiemus. Commoda autem et incommoda in eo genere sunt, quae praeposita et reiecta diximus; -, sed ut hoc iudicaremus, non esse in iis partem maximam positam beate aut secus vivendi. Similiter sensus, cum accessit ad naturam, tuetur illam quidem, sed etiam se tuetur; Et hi quidem ita non s', NULL, NULL, 1, 'chat.link/join?v=0iw3r0wfv05cl', 'drive.link/open?f=pk1qxqbbxcs4d3vv1eivn3fu3k75ig97pgfsbsrcwiwcx4m9byxhycbneyrefahiqi', 'Constitution du groupe en cours et brainstorm des idées sur le déroulement de la fête.', 3, 1, 82, '2020-07-16 17:00:01'),
	(13, 'GT Bien-être', 'S\'occupe de gérer les conflits à l\'interne et de veiller au bien-être de chaque membre, via la boîte aux lettres.', '', 'Lorem ipsum dolor sit amet, consectetur adipiscing elit. Non potes ergo ista tueri, Torquate, mihi crede, si te ipse et tuas cogitationes et studia perspexeris; Cum salvum esse flentes sui respondissent, rogavit essentne fusi hostes. Sed ad bona praeterita redeamus. Duo Reges: constructio interrete. Praeclare enim Plato: Beatum, cui etiam in senectute contigerit, ut sapientiam verasque opiniones assequi possit. Nihil enim arbitror esse magna laude dignum, quod te praetermissurum credam aut mor', NULL, NULL, 1, 'chat.link/join?v=z4ayurtwr5', 'drive.link/open?f=kuj5lbzipju2vj3vz8n73sw5tqeuttj14el3n7ifemzr1a3z2uj6x236a', '', 1, 2, 9, '2019-10-22 04:50:06');
