	(1, 'josette27', 'JRD', 'Josette', 'Richard', 'chat.link/user?t=k4yhg46m2e5', 'josette.richard@assoc.ch', '3647423253', 'Dans le milieu associatif, depuis 10 ans déjà, je suis à dans assoc depuis 2015 et j\'aide plusieurs heures par semaines. La partie contact médias m\'intéresse beaucoup. Je suis photorgaphe de métier, mais aussi céramiste et je cultive un petit potager...', '$2y$10$reiDwwW0o6nCC8WqB8LiTOCQqtTdIXr8crO4iX38hu3SUqexIv5X6', '2020-08-12 09:02:44', 0, 'Actuellement en vacances, je reviendrai le 15. En cas d\'urgence laissez moi un SMS et je vous rappelerai en soirée.', 4, 1, '2020-09-13 20:13:17'),
	(2, 'vincent59', 'VRT', 'Vincent', 'Rigot', '', 'vincent.rigot@assoc.ch', '9341086846', 'Je suis passionné de litérrature, et la presse me questionne beaucoup aujourd\'hui. Les sujets polémiques ne sont pas les plus intéressants, mais ceux dont on ne parle jamais regorgent d\'informations passionnantes et de récits fabuleux.', '$2y$10$7XYghsVDxePkdRdwG56ShuScadkLFy5ku6LdtdTJL3d0w6Zkv3H9C', '2019-01-06 05:50:28', 0, 'Actuellement en travail intense sur la rédaction d\'un document contenant des réflexions autour du militantisme à l\'époque des Romains!', 3, 1, '2020-06-15 23:33:08'),
	(3, 'megane13', 'MBN', 'Mégane', 'Blan', 'chat.link/user?t=kt9vo4fk6j11', 'megane.blan@assoc.ch', '6747043077', 'Je suis une passionée de festival. J\'en vais 4 fois par mois. Je trouvais le festival de Assoc vraiment génial alors j\'ai voulu venir ajouter mon grain de sel et aider pour la communication. Je suis fan de musique et je joue du violon. Je consacre 5h par semaine à Assoc la plupart de l\'année, et tout mon temps quand il y a le festival...', '$2y$10$PZZ.80pcP2wAPKQ42izNRuoNiKNOpyv8A5fwNPSNZVhsU.qPofLqq', '2019-09-01 06:09:13', 0, 'Encore quelques jours de repos avant de commencer à travailler à fond pour le festival. J\'aimerai que cette édition soit exceptionnelle!', 1, 1, '2020-04-13 00:16:08'),
	(4, 'michel78', 'MCE', 'Michel', 'Charrière', 'chat.link/user?t=xdpkyzu40z0ivt', 'michel.charriere@assoc.ch', '8216199083', 'Je suis nouveau ici et je découvre petit à petit le fonctionnement... Vestibulum ut eros non enim commodo hendrerit. Donec porttitor tellus non magna. Nam ligula elit, pretium et, rutrum non, hendrerit id, ante. Nunc mauris sapien, cursus in, hendrerit consectetuer, cursus et, magna. Praesent interdum ligula eu enim. Etiam imperdiet dictum magna. Ut tincidunt orci quis lectus.', '$2y$10$cNcBTdqZQ12eLsnsEcg7Je/hYDMc6N200nlv.rVfCu8CUtaFd5nB2', '2019-07-29 10:54:06', 0, NULL, 0, 1, NULL),
