	(1, 'Création sur crof.com', 'Création du compte sur la plafeforme de crowdfunding permettant de récolter les financements et d\'expliquer le but de ce financement participatif.', '2020-06-10 00:00:00', '2020-06-21 00:00:00', 2, 6, 8, 1, 0, 0, 0, 0, '2018-08-08 12:52:47', 2, 35, 100),
	(2, 'Texte présentation', 'Ecrire le texte qui présente le projet et le collectif. Il faut donner un aperçu de ce qui s\'est déjà fait les années précédentes et ce qui est prévu pour cette année de spécial qui fait que le collectif lance ce crowdfunding.', '2020-06-11 00:00:00', '2020-06-21 00:00:00', 2, 8, 9, 1, 0, 0, 0, 1, '2018-08-03 02:19:01', 2, 16, 92),
	(3, 'Vidéo présentation', 'Réaliser une vidéo pour présenter le festival. La vidéo sera affichée directement sur la première page sur crof.com quand les personnes intéressées cliqueront sur le lien.', '2020-06-15 00:00:00', '2020-06-30 00:00:00', 2, 6, 8, 0, 0, 0, 0, 0, '2018-08-02 15:47:14', 2, 62, 43),
	(4, 'Brainstorming de la faisabilité du projet', 'La gestion d\'une campagne crowdfunding demandant des compétences particulières et une énergie importante, le GT Festival doit discuter de son déroulement et des moyens à dispositions (notamment la collaboration avec d\'autres GTs).', '2020-06-02 00:00:00', '2020-06-08 00:00:00', 4, 8, 3, 1, 0, 0, 0, 0, '2018-07-28 04:45:29', 2, 20, 33),
	(5, 'Coordination + partage du travail entre les 4 GTs', '4 GTs qui travaillent en parallèle sur le même projet, on a vraiment besoin d\'une bonne coordination et un partage du travail clairement défini.', '2020-06-08 00:00:00', '2020-06-13 00:00:00', 4, 9, 3, 1, 0, 0, 0, 0, '2018-07-31 07:38:12', 2, 44, NULL),
	(6, 'Comptabilité finale', 'Décompte et validations des dons', '2020-07-15 00:00:00', '2020-07-25 00:00:00', 1, 9, 6, 1, 0, 0, 0, 0, '2018-08-07 12:53:48', 2, 97, NULL),
	(7, 'Gestion des demandes par email', 'Gestion des demandes et questions par email à propos du crowdfunding. Actuellement en pause parce que pas le temps avec les autres travaux.', '2020-06-10 00:00:00', '2020-07-30 00:00:00', 3, 5, 5, 1, 0, 0, 0, 0, '2018-07-23 23:08:51', 2, 70, NULL),
	(8, 'Résoudre les questions juridiques', 'Les questions juridiques quand au possible remboursement après dons doivent être résolues afin de limiter les problèmes par la suite.', '2020-06-08 00:00:00', '2020-06-10 00:00:00', 4, 3, 4, 1, 0, 0, 0, 0, '2018-07-28 07:59:42', 2, 51, NULL),
	(9, 'Communication sur la campagne', 'Envoi à travers la newsletter, les réseaux sociaux et autres canaux de communications externes, un message pour appeler les personnes qui nous suivent à participer au crowdfunding, en joignant à ce message un lien vers crof.com', '2020-07-01 00:00:00', '2020-07-03 00:00:00', 1, 10, 5, 1, 0, 0, 0, 0, '2018-08-05 10:18:11', 2, 83, NULL),
